{
	return vKeyPositions;
}

export function Initialize()
{
	SetupChannels();
}

export function Shutdown()
{
	SendChannel(0, true);
}

function SendChannel(Channel, shutdown = false)
{
	let ChannelLedCount = device.channel(ChannelArray[Channel][0]).ledCount;
	let componentChannel = device.channel(ChannelArray[Channel][0]);

	let RGBData = [];

	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline", "RBG");
	}
	else if(LightingMode === "Forced")
	{
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline", "RBG");
	}
	else if(componentChannel.shouldPulseColors())
	{
		ChannelLedCount = 90;

		let pulseColor = device.getChannelPulseColor(ChannelArray[Channel][0], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline", "RBG");
	}
	else
	{
		RGBData = device.channel(ChannelArray[Channel][0]).getColors("Inline", "RBG");
	}

	let offset = 0;
	let currPacket = 5;
	let shiftPackets = 4;

	let packet = new Array(365).fill(0);
	packet[0] = 0x0b;
	packet[1] = Channel;
	packet[2] = ChannelLedCount;

	for(let LedIdx = 0; LedIdx < ChannelLedCount; LedIdx++)
	{
		offset = 2 + LedIdx + shiftPackets;
		packet[currPacket] = RGBData[currPacket-offset];
		packet[currPacket+1] = RGBData[currPacket+1-offset];
		packet[currPacket+2] = RGBData[currPacket+2-offset];
		currPacket += shiftPackets;
	}

	device.bulk_transfer(0x02, packet, 364);
}

export function Render()
{
	SendChannel(0);
	device.pause(1);
}

